import { DashboardIcon, DocumentIcon, UsersIcon } from './sidebarIcons';

const sidebarItems = [
  {
    name: 'courses',
    title: 'courses',
    icon:  DashboardIcon,
    path: '/courses'
  },
  {
    name: 'document',
    title: 'document',
    icon:  DocumentIcon,
    path: '/document'
  },
  {
    name: 'users',
    title: 'users',
    icon:  UsersIcon,
    path: '/users'
  }
];

export default sidebarItems;
